import Header from "./Header";
import { FoodContextProvider } from "../../Storage/FoodContext";
import Foods from "./Foods";

const MainPage = (props) => {
  return (
    <div>
      <Header />
      <FoodContextProvider>
        <div></div>
        <Foods />
      </FoodContextProvider>
    </div>
  );
};

export default MainPage;
